import React from 'react'
import { SocialIcon } from 'react-social-icons'

import './SocialLinks.css'

function SocialLinks() {
  return (
    <div className="SocialLinks">
      <SocialIcon url="http://facebook/" style={{ height: 30, width: 30, marginLeft: 10 }}/>
      <SocialIcon url="http://instagram/" style={{ height: 30, width: 30, marginLeft: 10 }} />
      <SocialIcon url="http://whatsapp/" style={{ height: 30, width: 30 }} />
    </div>
  );
}

export default SocialLinks;
